import React from 'react';
import { AppBar, Toolbar, IconButton, Typography, SearchIcon, StyledInputBase } from '@mui/material';

const Header = () => {
    return (
        <AppBar position='static'>
            <Toolbar>
          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="open drawer"
            sx={{ mr: 2 }}
          ></IconButton>
          <Typography
            variant="h6"
            noWrap
            component="div"
            sx={{ display: { xs: 'none', sm: 'block' } }}
          ></Typography>
          <Search>
            <SearchIconWrapper>
              <SearchIcon />
            </SearchIconWrapper>
            <StyledInputBase
              placeholder="Searchâ€¦"
              inputProps={{ 'aria-label': 'search' }}
            />
          </Search>
          </Toolbar>
        </AppBar>
    )
}

export default Header;
